import React from 'react';
import './menu-item.styles.scss';

const MenuItem = ( data ) => (    
<div>

{ data.map((data) => {
<div className ="menu-item">
        <div className="content">
            <h1 className="title"> {data.title} </h1>
            <span className="subtitle"> SHOP NOW </span>
        </div>
    </div>
})}
    
</div>
)




export default MenuItem;
